from sympy.ntheory.factor_ import digits
from sympy import isprime, primerange
def B(n):
    l=[]
    for b in range(2, n - 1):
        d=digits(n, b)[1:]
        if max(d)==min(d): l.append(n)
    return l
print([n for n in primerange(2, 1001) if not B(n)]) # _Indranil Ghosh_, Jun 22 2017

